import { configureStore,persistStore } from "@reduxjs/toolkit";
import todosSlice from "./todos/todosSlice";


export const store =configureStore({
    reducer:{
        todos: todosSlice,
    },
})
export const persistor = persistStore(store) // <-- store not invoked
